import json

with open('input.json') as f:
    data = json.load(f)

people = []
organizations = []
locations = []

for item in data['news']['text'].split():
    if item.startswith(("Adamson", "Dieter")):
        people.append(item)
    elif item.startswith(("Faraday", "Daimler")):
        organizations.append(item)
    elif item.startswith(("Berlin")):
        locations.append(item)

print(f"{len(people)} people")
print(f"{len(organizations)} organizations")
print(f"{len(locations)} locations")

with open('output.json', 'w') as f:
    json.dump({
        "people": people,
        "organizations": organizations,
        "locations": locations
    }, f)
